                        </Col>
                        <Col lg={3} md={3} sm={5} xs={8}>
                            <Form.Control
                                as="select"
                                name="product_type"
                                size="sm"
                                value={props.product_type_values}
                                onChange={(e) => { props.onChange(e); props.productTypeHandler(e) }}
