                                                                    </Form.Control>
                                                                </InputGroup.Prepend>
                                                                <Form.Control.Feedback type="invalid">
                                                                    {props.product_warranty_errors}
                                                                </Form.Control.Feedback>
                                                            </InputGroup>
                                                        </Form.Group>
