                                                                <Form.Control
                                                                    type="number"
                                                                    size="sm"
                                                                    placeholder="Enter Discount on on Product(%)"
                                                                    name="product_discount"
                                                                    value={props.product_discount_values}
                                                                    onChange={props.onChange}
                                                                    isInvalid={props.product_discount_errors}
                                                                />
