                                                    <InputGroup>
                                                        <Form.Control
                                                            type="text"
                                                            size="sm"
                                                            placeholder="Enter SKU (Stock Keeping Unit)"
                                                            name="sku"
                                                            value={props.sku_values}
                                                            onChange={props.onChange}
                                                            isInvalid={props.sku_errors}
                                                        />
                                                        <Form.Control.Feedback type="invalid">
                                                            {props.sku_errors}
                                                        </Form.Control.Feedback>
                                                    </InputGroup>
                                                </Form.Group>
                                            </Form.Row>
                                        </Tab.Pane>




